def search(nums):
    left, right = 0, len(nums) - 1

    while left < right:
        mid = left + (right - left) // 2

        # Check if mid is even or odd
        if mid % 2 == 0:
            # If mid is even, check if it's the same as next element
            if nums[mid] == nums[mid + 1]:
                # The single element is in the right half
                left = mid + 2
            else:
                # The single element is in the left half (including mid)
                right = mid
        else:
            # If mid is odd, check if it's the same as previous element
            if nums[mid] == nums[mid - 1]:
                # The single element is in the right half
                left = mid + 1
            else:
                # The single element is in the left half
                right = mid - 1

    return nums[left]

