def sum_common_divisors(a, b):
    def gcd(x, y):
        while y:
            x, y = y, x % y
        return x

    common_divisor = gcd(a, b)

    divisor_sum = 0
    for i in range(1, common_divisor + 1):
        if common_divisor % i == 0:
            divisor_sum += i

    return divisor_sum

