def is_majority(arr, n, x):
    # Find the first occurrence of x
    def first_occurrence(arr, n, x):
        low, high = 0, n - 1
        result = -1
        while low <= high:
            mid = (low + high) // 2
            if arr[mid] == x:
                result = mid
                high = mid - 1
            elif arr[mid] < x:
                low = mid + 1
            else:
                high = mid - 1
        return result

    # Find the last occurrence of x
    def last_occurrence(arr, n, x):
        low, high = 0, n - 1
        result = -1
        while low <= high:
            mid = (low + high) // 2
            if arr[mid] == x:
                result = mid
                low = mid + 1
            elif arr[mid] < x:
                low = mid + 1
            else:
                high = mid - 1
        return result

    first = first_occurrence(arr, n, x)
    if first == -1:
        return False

    last = last_occurrence(arr, n, x)
    count = last - first + 1

    return count > n // 2

