def newman_prime(n):
    if n <= 0:
        return None

    # Newman-Shanks-Williams primes are primes of the form (1 + (1 + sqrt(2))^n + (1 - sqrt(2))^n) / 2
    # But we can compute them using recurrence relation
    # Let S(n) = (1 + sqrt(2))^n + (1 - sqrt(2))^n
    # S(0) = 2, S(1) = 2
    # S(n) = 2*S(n-1) + S(n-2)

    # The nth Newman-Shanks-Williams number is S(n)/2
    # We need to find when S(n)/2 is prime

    def is_prime(num):
        if num < 2:
            return False
        if num == 2:
            return True
        if num % 2 == 0:
            return False
        for i in range(3, int(num**0.5) + 1, 2):
            if num % i == 0:
                return False
        return True

    # Generate Newman-Shanks-Williams numbers and check for primality
    s_prev2 = 2  # S(0)
    s_prev1 = 2  # S(1)

    count = 0
    i = 0

    while count < n:
        if i == 0 or i == 1:
            ns_w = s_prev1 // 2
        else:
            s_current = 2 * s_prev1 + s_prev2
            ns_w = s_current // 2
            s_prev2 = s_prev1
            s_prev1 = s_current

        if is_prime(ns_w):
            count += 1
            if count == n:
                return ns_w

        i += 1

    return None

