def set_left_most_unset_bit(n):
    if n == 0:
        return 1

    # Find the position of the leftmost unset bit
    pos = 0
    temp = n
    while temp > 0:
        if temp & 1 == 0:
            pos = pos + 1
        temp = temp >> 1

    # If all bits are set, return n
    if pos == 0:
        return n

    # Set the leftmost unset bit
    return n | (1 << (pos - 1))

