def cal_sum(n):
    if n <= 0:
        return 0

    # Initialize first three Perrin numbers
    p0, p1, p2 = 3, 0, 2

    if n == 1:
        return p0
    elif n == 2:
        return p0 + p1
    elif n == 3:
        return p0 + p1 + p2

    # Calculate sum of first 3 numbers
    total_sum = p0 + p1 + p2

    # Calculate remaining Perrin numbers and add to sum
    for i in range(4, n + 1):
        next_perrin = p0 + p1
        total_sum += next_perrin
        # Shift values for next iteration
        p0, p1, p2 = p1, p2, next_perrin

    return total_sum

def max_product(arr):
    if not arr:
        return 0

    n = len(arr)
    max_prod = [0] * n
    max_prod[0] = arr[0]

    for i in range(1, n):
        max_prod[i] = arr[i]
        for j in range(i):
            if arr[j] < arr[i]:
                max_prod[i] = max(max_prod[i], max_prod[j] * arr[i])

    return max(max_prod)

def tuple_intersection(list1, list2):
    # Convert tuples to sets to ignore order, then find intersection
    set1 = {tuple(sorted(t)) for t in list1}
    set2 = {tuple(sorted(t)) for t in list2}

    # Find intersection of the sets
    intersection = set1 & set2

    # Convert back to tuples with original order from list1
    result = set()
    for t in list1:
        sorted_t = tuple(sorted(t))
        if sorted_t in intersection:
            result.add(t)

    return result

