def max_sum_increasing_subseq(arr, n, i, k):
    if k <= i:
        return 0

    # Initialize dp array
    dp = [0] * n

    # Fill dp array for elements up to index i
    for j in range(i + 1):
        dp[j] = arr[j]
        for m in range(j):
            if arr[m] < arr[j]:
                dp[j] = max(dp[j], dp[m] + arr[j])

    # Find maximum sum increasing subsequence that includes arr[k]
    max_sum = 0
    for j in range(i + 1):
        if arr[j] < arr[k]:
            max_sum = max(max_sum, dp[j])

    return max_sum + arr[k]

def max_sum_increasing_subseq(arr, n, k, i):
    if i < 0 or k > i or k < 0:
        return 0

    # dp[j] represents the maximum sum of increasing subsequence ending at index j
    dp = [0] * (i + 1)

    # Initialize dp array with the elements themselves
    for j in range(i + 1):
        dp[j] = arr[j]

    # Fill dp array
    for j in range(1, i + 1):
        for prev in range(j):
            if arr[prev] < arr[j]:
                dp[j] = max(dp[j], dp[prev] + arr[j])

    # Find maximum sum subsequence that includes element at index k
    max_sum = 0
    for j in range(k, i + 1):
        if arr[k] <= arr[j]:
            max_sum = max(max_sum, dp[j])

    return max_sum

