def get_median(list1, list2, n):
    merged = []
    i, j = 0, 0

    while i < n and j < n:
        if list1[i] <= list2[j]:
            merged.append(list1[i])
            i += 1
        else:
            merged.append(list2[j])
            j += 1

    while i < n:
        merged.append(list1[i])
        i += 1

    while j < n:
        merged.append(list2[j])
        j += 1

    mid1 = merged[n - 1]
    mid2 = merged[n]

    return (mid1 + mid2) / 2.0

