def amicable_numbers_sum(n):
    def sum_of_divisors(num):
        divisors_sum = 1
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                divisors_sum += i
                if i != num // i:
                    divisors_sum += num // i
        return divisors_sum

    amicable_sum = 0
    for i in range(2, n + 1):
        sum_div = sum_of_divisors(i)
        if sum_div > i and sum_div <= n:
            if sum_of_divisors(sum_div) == i:
                amicable_sum += i + sum_div

    return amicable_sum

