def magic_square_test(matrix):
    n = len(matrix)
    if n == 0:
        return False

    # Calculate the sum of the first row to use as reference
    magic_sum = sum(matrix[0])

    # Check all rows
    for row in matrix:
        if sum(row) != magic_sum:
            return False

    # Check all columns
    for col in range(n):
        if sum(matrix[row][col] for row in range(n)) != magic_sum:
            return False

    # Check main diagonal
    if sum(matrix[i][i] for i in range(n)) != magic_sum:
        return False

    # Check anti-diagonal
    if sum(matrix[i][n-1-i] for i in range(n)) != magic_sum:
        return False

    return True

