def pancake_sort(arr):
    def flip(sublist, k):
        sublist[:k] = sublist[:k][::-1]

    def find_max_index(sublist, n):
        max_index = 0
        for i in range(1, n):
            if sublist[i] > sublist[max_index]:
                max_index = i
        return max_index

    n = len(arr)
    for size in range(n, 1, -1):
        max_index = find_max_index(arr, size)
        if max_index != size - 1:
            if max_index != 0:
                flip(arr, max_index + 1)
            flip(arr, size)

    return arr

