def get_total_number_of_sequences(m, n):
    if n == 0:
        return 1
    if n == 1:
        return m

    # dp[i][j] represents number of sequences of length i ending with j
    dp = [[0] * (m + 1) for _ in range(n + 1)]

    # Base case: sequences of length 1
    for j in range(1, m + 1):
        dp[1][j] = 1

    # Fill the dp table
    for i in range(2, n + 1):
        for j in range(1, m + 1):
            # For each possible previous element k where 2*k <= j
            for k in range(1, j // 2 + 1):
                dp[i][j] += dp[i-1][k]

    # Sum all sequences of length n
    return sum(dp[n][j] for j in range(1, m + 1))

