    n = len(arr)
    if n == 0:
        return 0

    # Initialize arrays to store maximum sum of increasing and decreasing subsequences
    inc = [0] * n
    dec = [0] * n

    # Fill inc[] such that inc[i] stores the maximum sum of increasing subsequence ending at i
    for i in range(n):
        inc[i] = arr[i]
        for j in range(i):
            if arr[j] < arr[i] and inc[j] + arr[i] > inc[i]:
                inc[i] = inc[j] + arr[i]

    # Fill dec[] such that dec[i] stores the maximum sum of decreasing subsequence starting at i
    for i in range(n-1, -1, -1):
        dec[i] = arr[i]
        for j in range(i+1, n):
            if arr[j] < arr[i] and dec[j] + arr[i] > dec[i]:
