def max_sub_array_sum_repeated(arr, n, k):
    def kadane(arr):
        max_ending_here = max_so_far = arr[0]
        for i in range(1, len(arr)):
            max_ending_here = max(arr[i], max_ending_here + arr[i])
            max_so_far = max(max_so_far, max_ending_here)
        return max_so_far

    if k == 1:
        return kadane(arr)

    total_sum = sum(arr)
    max_prefix_sum = float('-inf')
    max_suffix_sum = float('-inf')

    prefix_sum = 0
    for i in range(n):
        prefix_sum += arr[i]
        max_prefix_sum = max(max_prefix_sum, prefix_sum)

    suffix_sum = 0
    for i in range(n-1, -1, -1):
        suffix_sum += arr[i]
        max_suffix_sum = max(max_suffix_sum, suffix_sum)

    max_kadane = kadane(arr)

    if total_sum > 0:
        return max(max_kadane, max_prefix_sum + max_suffix_sum + (k-2) * total_sum)
    else:
        return max(max_kadane, max_prefix_sum + max_suffix_sum)

