        suffix_sum[i] = suffix_sum[i+1] + arr[i]

    max_prefix_sum = max(prefix_sum)
    max_suffix_sum = max(suffix_sum)

    max_subarray_sum = kadane(arr, n)

    if total_sum > 0:
        return max(max_subarray_sum, max_prefix_sum + max_suffix_sum + (k-2) * total_sum)
    else:
        return max(max_subarray_sum, max_prefix_sum + max_suffix_sum)

