    def kadane(arr, n):
        max_so_far = float('-inf')
        max_ending_here = 0
        for i in range(n):
            max_ending_here += arr[i]
            max_so_far = max(max_so_far, max_ending_here)
            if max_ending_here < 0:
                max_ending_here = 0
        return max_so_far

    if k == 1:
        return kadane(arr, n)

    prefix_sum = [0] * n
    suffix_sum = [0] * n

    prefix_sum[0] = arr[0]
    for i in range(1, n):
        prefix_sum[i] = prefix_sum[i-1] + arr[i]

    suffix_sum[n-1] = arr[n-1]
    for i in range(n-2, -1, -1):
        suffix_sum[i] = suffix_sum[i+1] + arr[i]

    total_sum = prefix_sum[n-1]

    max_prefix_sum = max(prefix_sum)
    max_suffix_sum = max(suffix_sum)

    result = kadane(arr, n)

    if total_sum > 0:
        result = max(result, max_prefix_sum + max_suffix_sum + (k-2) * total_sum)
    else:
        result = max(result, max_prefix_sum + max_suffix_sum)

    return result

