    sum2 = get_max_sum(n // 2, memo)
    sum3 = get_max_sum(n // 3, memo)
    sum4 = get_max_sum(n // 4, memo)
    sum5 = get_max_sum(n // 5, memo)

    # Return the maximum of either keeping the number as is or breaking it down
    memo[n] = max(n, sum2 + sum3 + sum4 + sum5)
    return memo[n]

