def move_zero(nums):
    # Count zeros and remove them from the list
    zero_count = 0
    i = 0
    while i < len(nums):
        if nums[i] == 0:
            nums.pop(i)
            zero_count += 1
        else:
            i += 1

    # Append zeros at the end
    nums.extend([0] * zero_count)
    return nums

def move_zero(nums):
    count = 0
    i = 0
    while i < len(nums):
        if nums[i] == 0:
            nums.pop(i)
            count += 1
        else:
            i += 1
    nums.extend([0] * count)
    return nums

