def maxAverageOfPath(matrix):
    if not matrix or not matrix[0]:
        return 0

    rows, cols = len(matrix), len(matrix[0])

    # dp[i][j] stores (max_sum, path_length) to reach cell (i,j)
    dp = [[(0, 0) for _ in range(cols)] for _ in range(rows)]

    # Initialize starting point
    dp[0][0] = (matrix[0][0], 1)

    # Fill first row (can only come from left)
    for j in range(1, cols):
        dp[0][j] = (dp[0][j-1][0] + matrix[0][j], dp[0][j-1][1] + 1)

    # Fill first column (can only come from above)
    for i in range(1, rows):
        dp[i][0] = (dp[i-1][0][0] + matrix[i][0], dp[i-1][0][1] + 1)

    # Fill the rest of the matrix
    for i in range(1, rows):
        for j in range(1, cols):
            # Choose the path with maximum sum
            if dp[i-1][j][0] > dp[i][j-1][0]:
                dp[i][j] = (dp[i-1][j][0] + matrix[i][j], dp[i-1][j][1] + 1)
            else:
                dp[i][j] = (dp[i][j-1][0] + matrix[i][j], dp[i][j-1][1] + 1)

    # Return the average of the maximum sum path
    max_sum, path_length = dp[rows-1][cols-1]
    return max_sum / path_length

